class Solution {
    /**
     * @param {string[]} strs
     * @return {string[][]}
     */
    groupAnagrams(strs) {

        const freq = {}
        for (let word of strs) {
            const freqArr = new Array(26).fill(0)
            for (let c of word) {
                let charCode = c.charCodeAt(0) - 'a'.charCodeAt(0)
                freqArr[charCode] = freqArr[charCode] + 1
            }

            let key = freqArr.join('')
            if (!(key in freq)) freq[key] = []
            freq[key].push(word)
        }

        return Object.values(freq)
    }
}

